import Vue from 'vue';
import App from './App.vue';
import router from './router';
import apolloProvider from './apollo';
import './plugins/bootstrap-vue'; // Importa Bootstrap-Vue si es necesario

Vue.config.productionTip = false;

new Vue({
  router,
  apolloProvider,
  render: h => h(App),
}).$mount('#app');
